import React from 'react'
import { useSignOut } from 'react-auth-kit'

export default function Logout() {
    const signOut = useSignOut()

    const signOutHandle = async (e) => {
        e.preventDefault();
        signOut();
    }
  return (
    <>
      <span onClick={ signOutHandle}>Sign Out</span>
    </>
  )
}
